window.bookSummaryJSON = "<p>Lieutenant Cora Harper joined the Systems Alliance to develop and enhance her powerful biotic talents. She was assigned to the asari commando unit Talein's Daughters, where she honed her abilities to become a skilled and deadly huntress. </p> <p>Returning to Earth, Cora finds herself a stranger among other humans, and joins the Andromeda Initiative as Alec Ryder's second-in-command. The mission will send 100,000 colonists on a one-way, 600-year-long journey into the unknown. When essential - and dangerous - tech is stolen, Cora is assigned to recover it before it can be used against the Initiative, and end the mission before it can begin. </p>"; 
